function Movie(){
    return(
        <>
        <Row xs={1} md={4} className="g-4">
                {movieArrr.map((item) => {
                    return <Col>
                        <Card style={{ width: '18rem' }}>
                            <Card.Img variant="top" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSqw8vmlYi7VaU8peOBxAWE0FmM_d7roPLpWk0t7q1k3g&s" />
                            <Card.Body>
                                <Card.Title>{item.title}</Card.Title>
                                <Card.Text>
                                    <p>{item.overview}</p>

                                </Card.Text>
                                <Button variant="primary">Go somewhere</Button>
                            </Card.Body>
                        </Card>
                    </Col>
                })}
            </Row>
        </>
    );
}

export default Movie;
